import React from "react";
import ReactDOM from "react-dom";
import * as cls from "./App";

ReactDOM.render(
    <>
        <ol>
            <li>Khushbu jain</li>
            <li> {cls.default}</li>
            <li> {cls.sis}</li>
            <li> {cls.sis1}</li>
            <li> {cls.sis2()}</li>
            <li> {cls.bro()}</li>
        </ol>
    </>,
    document.getElementById('root')
);
